import React from "react";

import { useSelector } from "react-redux";

import Header from "../../components/Header";
import List from "../../components/List";
import {
  Container,
  Banner,
  Pattern,
  Box,
  Debruy,
  Label1,
  Label2,
  Shape,
} from "./styles";

function Home() {
  return (
    <Container>
      <Header />
      <Banner>
        <Pattern />
        <Box>
          <Debruy />
          <Label1 />
          <Label2 />
        </Box>
      </Banner>
      <Shape />
      <List />
    </Container>
  );
}

export default Home;
